    function handleKeyDown(event)
    {
	var code = Number(event.keyCode);	
	var key = event.key;
	if (key === "ArrowDown") key = "downBtn";
	if (key === "ArrowUp")   key = "upBtn";	
	//console.log("here " + code + " " + key);

	if (currentTab !== container)
	    return;
		
	if (mode === "nextGame?")
	{
	    problemNumber++;
	    saveToLS("problemNumber",problemNumber);
	    init();
	} else if (mode === "grid")

	    /********** in grid mode ***********************/

	{
	    if (key === 'downBtn' && selectedRow < 5)
	    {
		var newSelection = selectedRow + 1;
		while (newSelection <= 6 && wordFound[newSelection] === 1)
		    newSelection++;
		if (newSelection != 6)
		    selectedRow = newSelection;
	    }
	    else if (key === 'upBtn' && selectedRow > -1)
	    {
		var newSelection = selectedRow - 1;
		while (newSelection > -2 && wordFound[newSelection] === 1)
		    newSelection--;
		if (newSelection != -2)
		    selectedRow = newSelection;
	    } else if (code >= 65 && code <= 90)
	    {
		/*** switch to guess mode ***/
		mode = "guess";
		guessNumber = 0;
		hideGridLeft();
		showGuessLeft();	
		correct = getWordInGrid(selectedRow);
		//console.log(correct);
	    }
	    if (event.stopPropagation)
		event.stopPropagation();
	    restyle();
	}
	if (mode === "guess")
	    /********** in guess mode ***********************/
	{
	    if (code === 13) // return/enter key
	    {
		/********** return key in guess mode ******************/
		
		if (charIndex === 5) 
		{
		    /********** complete word guessed ****************/
		    
		    var guess = guesses[guessNumber].join("");
		    if (validGuesses.indexOf(guess.toLowerCase()) < 0 &&
			words.indexOf(guess.toLowerCase()) < 0)
		    {
			/********** non-existing word guessed ************/
			notInWordList();
			setTimeout(function()
				   {
					   restyle();
				   }, 2000);
		    } else // valid guess
		    {
			/********** existing word guessed ****************/
			var correctGuess = score(guesses[guessNumber]);
			totalGuesses++;
			if (correctGuess || guessNumber === 5)
			{
			    /*** correct guess or ran out of guesses ***/
			    if (guessNumber === 5) // ran out of guesses
				    totalGuesses++;  // 1 penalty point
			    updateWordInGrid();
			    wordFound[selectedRow] = 1;
			    if (0 <= selectedRow &&  // if not a
				selectedRow <= 4)    // diagonal
			    {
				//check one diagonal ...
				var count = 0;
				for( var i = 0; i < 5; i++ )
				    count += reveal[i][i];
				if (count === 5)
				    wordFound[-1] = 1;
				
				// ... and the other
				count = 0;
				for( var i = 0; i < 5; i++ )
				    count += reveal[4-i][i];
				if (count === 5)
				    wordFound[5] = 1;			
			    }
			    guessNumber = -1;
			    gStyles = [ ["","","","",""],["","","","",""],
					["","","","",""],["","","","",""],
					["","","","",""],["","","","",""]];
			    guesses = [ ["","","","",""],["","","","",""],
					["","","","",""],["","","","",""],
					["","","","",""],["","","","",""]];
			    letterColor =
				[ "","","","","","","","","","","","","",
				  "","","","","","","","","","","","",""];
			    
			    selectedRow = -1;
			    while (selectedRow < 6 &&
				   wordFound[selectedRow] === 1)
				selectedRow++;
			    if (selectedRow === 6)
			    {
				selectedRow = -1; // default value
				hideGridLeft();
				hideGuessLeft();				
				gameOver();
				return;
				} else
			    {
				/**** go back to grid mode *****/
				mode = "grid";
				guessNumber = -1;
				showGridLeft();
				hideGuessLeft();
				letterColor =
				    [ "","","","","","","","","","","","","",
				      "","","","","","","","","","","","",""];
			    }
			} else
			{
			    /*** incorrect guess & not done *******/
			    guessNumber++;
			}
			charIndex = 0;
			restyle();
		    }// valid guess
		}// return key and complete guess
	    } else if (code >= 65 && code <= 90) // letter key
	    {
		//**** letter typed  *******/
		if (charIndex < 5)
		{
		    guesses[guessNumber][charIndex] = key.toUpperCase();
		    charIndex++;
		    restyle();
		}
	    } else if (code === 8 || code === 46) 
	    {
		/**** backspace or delete *******/
		if (charIndex > 0)
		{
		    charIndex--;
		    guesses[guessNumber][charIndex] = "";
		    restyle();
		}
	    }
	}// in guess mode
    };

 
    function score(inputGuess)
    {
	var numCorrectLetters = 0;
	var answer = [];
	var guess = [];
	for(var i = 0; i < 5; i++)
	{
	    answer.push(correct[i].toUpperCase());
	    guess.push(inputGuess[i]);
	}
	//console.log( "answer = " + answer);
	//console.log( "guess  = " + guess);

	// check for green letters first
	for(var i = 0; i < 5; i++) // loop on letters of the guess
	    if (guess[i] === answer[i])  // is it in the correct position
	    {
		answer[i] = '*'; // letter cannot be used in scoring any longer
		gStyles[guessNumber][i] = 'g'; // green
		var c = guess[i].charCodeAt(0) - 65;
		letterColor[c] = "g";
		guess[i] = '*';
		numCorrectLetters++;
		
	    }	
	//console.log( "score = " + gStyles[guessNumber]);
	for(var i = 0; i < 5; i++) // loop on letters of the guess
	{
	    if (guess[i] !== '*') // letter already scored as green
	    {
		// check if c is in the answer but at another location
		for(var j = 0; j < 5; j++)  // loop on the letters of the answer
		    if (answer[j] === guess[i])
	            {
			answer[j] = '*'; // letter is now used up for scoring
			gStyles[guessNumber][i] = 'y'; // yellow
			var c = guess[i].charCodeAt(0) - 65;
			if (letterColor[c] !== "g")
			    letterColor[c] = "y";
			break;
		    }
	    }
	}
	for( var i = 0; i < 5; i++)
	    if ( letterColor[guess[i].charCodeAt(0) - 65] === "")
		letterColor[guess[i].charCodeAt(0) - 65] = "d"; // darkgray
	return numCorrectLetters === 5;
    }// score
    
