    function getWordInGrid(selected)  // selected is in {-1,0,...,5}
    {
	switch (selected)
	{
	    case -1:
	    return [ grid[0][0], grid[1][1], grid[2][2], grid[3][3],
		     grid[4][4] ];
	    case 5:
	    return [ grid[4][0], grid[3][1], grid[2][2], grid[1][3],
		     grid[0][4] ];
	    default: return grid[selected];
	}
    }// getWordInGrid

    function updateWordInGrid()
    {
	if (selectedRow === -1)
	{
	    for( var c = 0; c < 5; c++)
		reveal[c][c] = 1;
	} else if (selectedRow === 5)
	{
	    for( var c = 0; c < 5; c++)
		reveal[4-c][c] = 1;
	} else
	{
	    for( var c = 0; c < 5; c++)
		reveal[selectedRow][c] = 1;
	}
    }
    
    function decode(code)
    {    
	var hi = codes[code];
	var low = codes[code+1];
	return [ // watch out: >>> returns a 32-bit integer
	    words[ Math.floor(hi / Math.pow(2,24))],
	    words[(hi >>> 12) & 4095 ],
	    words[hi & 4095],  words[(low >>> 12)], words[low & 4095]];
    }// decode

    function styleGrid()
    {
	var unselected = 'rgb(220,220,250)';
	var selected = 'white';	
	var id;
	for(var row = 0; row < 5; row++)
	{
	    for(var col = 0; col < 5; col++)
	    {
		var gLetterHeight = Math.floor(getComputedStyle(
		    document.getElementById("grid_0_0")).height.slice(0,-2));
		var fontSize = Math.floor(gLetterHeight-5) +"px";
		var cell =  document.getElementById("grid_" + row + "_" + col);
		cell.style.font = "600 " + fontSize + " Arial";
		cell.style.background = unselected;
		if (reveal[row][col])		    
		    cell.innerHTML = grid[row][col].toUpperCase();
		else
		    cell.innerHTML = "";
	    }
	}
	id = "row" + selectedRow;
	switch (selectedRow)
	{
	    case -1:
	    for(var i = 0; i < 5; i++)
		document.getElementById("grid_" + i + "_" + i)
		.style.background = selected;
	    break;
	    case 5:
	    for(var i = 0; i < 5; i++)
		document.getElementById("grid_" + (4-i) + "_" + i)
		.style.background = selected;
	    break;
	    default:
	    for(var i = 0; i < 5; i++)
		document.getElementById("grid_" + selectedRow + "_" + i)
		.style.background = selected;

	    document.getElementById(id).style.background = selected;
	    break;
	}
    }//  styleGrid

